// Individual Photo Component
const PhotoItem = ({ photo, index, scrollYProgress }) => {
  // Randomized scale curves for each image
  const maxScale = 1.0 + Math.random() * 0.2; // 1.0 to 1.2
  const minScale = 0.4 + Math.random() * 0.2; // 0.4 to 0.6

  // Slight vertical offset for collage effect
  const verticalOffset = (Math.random() * 50) - 25; // Â±25px up/down

  // Calculate initial horizontal position (spread across screen)
  const initialX = (index * 400) - (wineNightPhotos.length * 200); // Center the spread

  // Get current scroll progress
  const currentProgress = scrollYProgress.get ? scrollYProgress.get() : scrollYProgress;

  // Calculate horizontal translation based on scroll progress
  // As you scroll down (progress 0 to 1), photos move from right to left
  const translateX = initialX - (currentProgress * 4000); // Much larger movement range for dramatic carousel effect

  // Calculate scale based on horizontal position (center = max scale)
  let scale = minScale;
  const centerX = 0; // Center of screen
  const distanceFromCenter = Math.abs(translateX - centerX);

  if (distanceFromCenter <= 500) {
    // In center area - interpolate between min and max scale
    const scaleRatio = 1 - (distanceFromCenter / 500);
    scale = minScale + (maxScale - minScale) * scaleRatio;
  }

  // Z-index based on scale for layering
  const zIndex = Math.floor(scale * 100);

  // Add console log to debug
  console.log(`Photo ${index}: initialX=${initialX}, translateX=${translateX}, scale=${scale}, zIndex=${zIndex}`);

  return (
    <motion.div
      className="photo-item"
      style={{
        transform: `translateX(${translateX}px) translateY(${verticalOffset}px) scale(${scale})`,
        zIndex,
        position: 'absolute',
        left: '50%', /* Center horizontally */
        top: '50%',  /* Center vertically */
        marginLeft: '-150px', /* Half of image width */
        marginTop: '-200px'   /* Half of image height */
      }}
      initial={{ opacity: 0 }}
      whileInView={{ opacity: 1 }}
      viewport={{ once: true, margin: "-10%" }}
      transition={{ duration: 0.6, ease: "easeOut" }}
    >
      <img 
        src={photo} 
        alt={`Wine night photo ${index + 1}`}
        onError={(e) => console.error(`Failed to load image: ${photo}`)}
        onLoad={() => console.log(`Successfully loaded image: ${photo}`)}
      />
    </motion.div>
  );
};

// Photo Timeline Component - Simple Carousel
const PhotoTimeline = () => {
  const [currentIndex, setCurrentIndex] = useState(0);
  const [isDragging, setIsDragging] = useState(false);
  const [startX, setStartX] = useState(0);
  const [translateX, setTranslateX] = useState(0);

  // Handle wheel scroll
  const handleWheel = (e) => {
    e.preventDefault();
    const delta = e.deltaY;

    if (delta > 0) {
      // Scroll down - move to next photo
      setCurrentIndex(prev => Math.min(prev + 1, wineNightPhotos.length - 1));
    } else {
      // Scroll up - move to previous photo
      setCurrentIndex(prev => Math.max(prev - 1, 0));
    }
  };

  // Handle mouse drag
  const handleMouseDown = (e) => {
    setIsDragging(true);
    setStartX(e.clientX - translateX);
  };

  const handleMouseMove = (e) => {
    if (!isDragging) return;

    // Use requestAnimationFrame for smooth dragging
    requestAnimationFrame(() => {
      const newTranslateX = e.clientX - startX;
      setTranslateX(newTranslateX);
    });
  };

  const handleMouseUp = () => {
    setIsDragging(false);

    // Snap to nearest photo
    const photoWidth = 250; // Width of each photo (updated to match new spacing)
    const snappedIndex = Math.round(-translateX / photoWidth);
    const clampedIndex = Math.max(0, Math.min(snappedIndex, wineNightPhotos.length - 1));

    setCurrentIndex(clampedIndex);
    setTranslateX(-clampedIndex * photoWidth);
  };

  // Calculate positions for all photos
  const getPhotoStyle = (index) => {
    const baseX = index * 250; // 250px spacing between photos (closer together)
    const currentX = baseX + translateX;

    // The center of the screen is at 0 since we're using left: 50% and marginLeft: -150px
    const centerX = 0;
    const distanceFromCenter = Math.abs(currentX - centerX);

    // Smooth continuous scaling based on distance from center
    let scale = 0.4; // Smaller base scale for edge photos

    if (distanceFromCenter <= 400) {
      // Smooth interpolation between min and max scale
      const scaleRatio = 1 - (distanceFromCenter / 400);
      scale = 0.4 + (0.8 * scaleRatio); // Smoothly from 0.4 to 1.2
    }

    // Add vertical staggering - alternate between slightly up and down
    const verticalOffset = (index % 2 === 0) ? 30 : -20; // Stagger vertically

    // Remove random jitter during dragging for smoother performance
    const horizontalJitter = isDragging ? 0 : (Math.random() - 0.5) * 40;

    return {
      transform: `translateX(${currentX + horizontalJitter}px) translateY(${verticalOffset}px) scale(${scale})`,
      zIndex: Math.floor(scale * 100),
      opacity: 0.4 + (0.6 * (scale - 0.4) / 0.8) // Smooth opacity transition too
    };
  };

  return (
    <div 
      className="photo-timeline-container" 
      onWheel={handleWheel}
      onMouseDown={handleMouseDown}
      onMouseMove={handleMouseMove}
      onMouseUp={handleMouseUp}
      onMouseLeave={handleMouseUp}
      style={{ cursor: isDragging ? 'grabbing' : 'grab' }}
    >
      <div className="photo-timeline">
        {/* Debug info */}
        <div style={{ 
          position: 'fixed', 
          top: '100px', 
          left: '20px', 
          color: 'white', 
          zIndex: 9999,
          background: 'rgba(0,0,0,0.8)',
          padding: '10px',
          borderRadius: '5px'
        }}>
          <div>Current Index: {currentIndex}</div>
          <div>Translate X: {translateX.toFixed(0)}</div>
          <div>Photos Count: {wineNightPhotos.length}</div>
          <div>Is Dragging: {isDragging ? 'Yes' : 'No'}</div>
        </div>

        {wineNightPhotos.map((photo, index) => (
          <div
            key={index}
            className="photo-item"
            style={{
              ...getPhotoStyle(index),
              position: 'absolute',
              left: '50%',
              top: '50%',
              marginLeft: '-150px',
              marginTop: '-200px',
              transition: isDragging ? 'none' : 'transform 0.4s cubic-bezier(0.25, 0.46, 0.45, 0.94)'
            }}
          >
            <img
              src={photo}
              alt={`Wine night photo ${index + 1}`}
              style={{
                width: '300px',
                height: '400px',
                objectFit: 'cover',
                borderRadius: '8px',
                border: '2px solid #333'
              }}
            />
          </div>
        ))}
      </div>
    </div>
  );
};

// Draggable Folder Component
const DraggableFolder = ({ name, initialX, initialY, onOpen }) => {
  const [position, setPosition] = useState({ x: initialX, y: initialY });
  const [isDragging, setIsDragging] = useState(false);
  const [dragStart, setDragStart] = useState({ x: 0, y: 0 });

  const handleMouseDown = (e) => {
    e.preventDefault();
    setIsDragging(true);
    setDragStart({
      x: e.clientX - position.x,
      y: e.clientY - position.y
    });
  };

  const handleMouseMove = (e) => {
    if (isDragging) {
      setPosition({
        x: e.clientX - dragStart.x,
        y: e.clientY - dragStart.y
      });
    }
  };

  const handleMouseUp = () => {
    setIsDragging(false);
  };

  const handleClick = (e) => {
    if (!isDragging) {
      onOpen(name);
    }
  };

  useEffect(() => {
    if (isDragging) {
      document.addEventListener('mousemove', handleMouseMove);
      document.addEventListener('mouseup', handleMouseUp);
      return () => {
        document.removeEventListener('mousemove', handleMouseMove);
        document.removeEventListener('mouseup', handleMouseUp);
      };
    }
  }, [isDragging, dragStart]);

  return (
    <div
      className="draggable-folder"
      style={{
        position: 'absolute',
        left: position.x,
        top: position.y,
        cursor: isDragging ? 'grabbing' : 'grab'
      }}
      onMouseDown={handleMouseDown}
      onClick={handleClick}
    >
      <img src="/macOSfolder.png" alt="folder" className="folder-icon" />
      <span className="folder-name">{name}</span>
    </div>
  );
};

